pragma solidity ^0.8.0;

contract MyContract {
     struct TicketReservation {
        address reservedBy;
        uint256 timestamp;
    }
    mapping(uint => TicketReservation) public ticketReservations;
    address[16] public tikets;
    uint public balanceWei = 0;
    address payable public admin  = payable(0x50d3b84a2b1787b7704DD50c67733b6b5B293629);
    //transferir tiket
    function transferTicket(uint tiketIndex, address newOwner) public {
        require(tiketIndex >= 0 && tiketIndex <= 15, "Invalid ticket index");
        require(tikets[tiketIndex] == msg.sender, "You are not the owner of this ticket");
        tikets[tiketIndex] = newOwner;
    }
    //reservar tiket
    function bookTiket(uint tiketIndex) public {
        require(tiketIndex >= 0 && tiketIndex <= 15, "Invalid ticket index");
        require(tikets[tiketIndex] == address(0), "Ticket already purchased");
        require(ticketReservations[tiketIndex].reservedBy == address(0) || 
                (block.timestamp - ticketReservations[tiketIndex].timestamp) > 120, "Ticket already reserved");

        ticketReservations[tiketIndex] = TicketReservation({
            reservedBy: msg.sender,
            timestamp: block.timestamp
        });
    }
    function transferbalanceToAdmin () public {
        require(msg.sender == admin, "No eres el admin");

        admin.transfer(balanceWei);
        balanceWei = 0;
    }
    //cambiar admin
    function changeAdmin( address payable newAdmin) public  {
        require(msg.sender == admin, "No eres el admin");
        admin = payable(newAdmin);
    }
     function buyTiket(uint tiketIndex) payable public returns (bool) {
        // Comprobación
        require(tiketIndex >= 0 && tiketIndex <= 15);
        require(msg.value == 0.02 ether, "Insuficient amount of BNB");
        // Verifica que el ticket no ha sido comprado previamente
        require(tikets[tiketIndex] == address(0), "Este ticket ya ha sido comprado");
        TicketReservation storage reservation = ticketReservations[tiketIndex];
        if (reservation.reservedBy != address(0)) {
        //verifa que el comrpador sea la misma persona que l reservó
        require(reservation.reservedBy == msg.sender, "Ticket not reserved for caller");
        }
        // Reset reservation after successful purchase
        delete ticketReservations[tiketIndex];
        balanceWei += msg.value;
        tikets[tiketIndex] = msg.sender;
        return true;
    } 
    function getTikets() public view returns (address[16] memory ) {
        return tikets;
    }
     // obtener balance  
    function getContractBalance() public view returns (uint256, uint256) {
        return (address(this).balance, balanceWei);
    }


}
